package com.TNS.DemoForTraining;

public class WhileDemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i=10;
		while(i<=100) {
			System.out.println(i);
			i++;
		}
		System.out.println("---------------------------------------------------------");
		for(int a =1;a<=100;a++) {
			System.out.println(a);
		}
	}

}
